import React from "react";

function Footer() {
  return (
    <div>
      <div>
        <ul>
          <li>About us</li>
          <li>Contact us</li>
          <li>Terms & Conditions</li>
          <li>Returns</li>
          <li>Delivery Information</li>
        </ul>
      </div>
    </div>
  );
}

export default Footer;
